using AspNetCore.LegacyAuthCookieCompat;
class Kadar {

        private const string SHA512ValidationKey = "DAF0934BA4B44017CD792A9D93694933B1373C02F1DC04432E9AF625E9B743E4C76FA06D5298450460BDE67915D6A12D174D7815D5F27A9F7CDACCC5C34BDEB1";
        private const string SHA512DecryptionKey = "D99054E776CB293D546C4091B617A70CBB464117CF1D6429";

    public static void Main(string[] args)
    {
        LegacyFormsAuthenticationTicketEncryptor encryptor = new LegacyFormsAuthenticationTicketEncryptor(SHA512DecryptionKey, SHA512ValidationKey, ShaVersion.Sha512, CompatibilityMode.Framework20SP2);
        string encryptedTicket = "";
        if (args.Length == 0)
        {
            encryptedTicket = "";
        }
        else
        {
            encryptedTicket = args[0];
        }
        FormsAuthenticationTicket unencryptedTicket = encryptor.DecryptCookie(encryptedTicket);
        Console.WriteLine(unencryptedTicket.Version);
        Console.WriteLine(unencryptedTicket.Name);
        Console.WriteLine(unencryptedTicket.IssueDate);
        Console.WriteLine(unencryptedTicket.Expiration);
        Console.WriteLine(unencryptedTicket.IsPersistent);
        Console.WriteLine(unencryptedTicket.UserData);
        Console.WriteLine(unencryptedTicket.CookiePath);

    }



}



